public static String getRules() {
  String ruleString = null;
  if (rules != null) {
    StringBuilder sb = new StringBuilder();
    for (Rule rule : rules) {
      sb.append(rule.toString()).append("\n");
    }
    ruleString = sb.toString().trim();
  }
  return ruleString;
}
